package vo;import java.io.Serializable;public class tablaPosicionesVO implements Serializable{	private static final long serialVersionUID = -448956718428085248L;		private Integer idTabla;	private ClubVO c;	private CampeonatoVO camp;	private Integer cantidadJugados;	private Integer cantidadganados;	private Integer cantidadempatados;	private Integer cantidadperdidos;	private Integer golesFavor;	private Integer golesContra;	private Integer diferenciaGoles;	private Integer puntos;	private Float promedio;					public tablaPosicionesVO( Integer idTabla,	 ClubVO c,	 CampeonatoVO camp,	 Integer cantidadJugados,	 Integer cantidadganados,	 Integer cantidadempatados,	 Integer cantidadperdidos,	 Integer golesFavor,	 Integer golesContra,	 Integer diferenciaGoles,	 Integer puntos,	 Float promedio) {		this.c=c;		this.camp=camp;		this.cantidadJugados=cantidadJugados;		this.cantidadganados=cantidadganados;		this.cantidadempatados=cantidadempatados;		this.cantidadperdidos=cantidadperdidos;		this.golesFavor=golesFavor;		this.golesContra=golesContra;		this.diferenciaGoles=diferenciaGoles;		this.puntos=puntos;		this.promedio=promedio;			}	public Integer getIdTabla() {		return idTabla;	}	public void setIdTabla(Integer idTabla) {		this.idTabla = idTabla;	}	public ClubVO getC() {		return c;	}	public void setC(ClubVO c) {		this.c = c;	}	public CampeonatoVO getCamp() {		return camp;	}	public void setCamp(CampeonatoVO camp) {		this.camp = camp;	}	public Integer getCantidadJugados() {		return cantidadJugados;	}	public void setCantidadJugados(Integer cantidadJugados) {		this.cantidadJugados = cantidadJugados;	}	public Integer getCantidadganados() {		return cantidadganados;	}	public void setCantidadganados(Integer cantidadganados) {		this.cantidadganados = cantidadganados;	}	public Integer getCantidadempatados() {		return cantidadempatados;	}	public void setCantidadempatados(Integer cantidadempatados) {		this.cantidadempatados = cantidadempatados;	}	public Integer getCantidadperdidos() {		return cantidadperdidos;	}	public void setCantidadperdidos(Integer cantidadperdidos) {		this.cantidadperdidos = cantidadperdidos;	}	public Integer getGolesFavor() {		return golesFavor;	}	public void setGolesFavor(Integer golesFavor) {		this.golesFavor = golesFavor;	}	public Integer getGolesContra() {		return golesContra;	}	public void setGolesContra(Integer golesContra) {		this.golesContra = golesContra;	}	public Integer getDiferenciaGoles() {		return diferenciaGoles;	}	public void setDiferenciaGoles(Integer diferenciaGoles) {		this.diferenciaGoles = diferenciaGoles;	}	public Integer getPuntos() {		return puntos;	}	public void setPuntos(Integer puntos) {		this.puntos = puntos;	}	public Float getPromedio() {		return promedio;	}	public void setPromedio(Float promedio) {		this.promedio = promedio;	}	public tablaPosicionesVO() {}			}